import React from "react";
import { useTranslation } from "react-i18next";
import Header from "../header-footer/header";
import Footer from "../header-footer/footer";
import "./home.css";

const Home = () => {
  const { t } = useTranslation();

  return (
    <div className="Home">
      <Header />
      <div className="home-main">
        <div className="section-1">
          <img 
            src="https://img.freepik.com/free-photo/close-up-green-leaves-nature_23-2149006020.jpg?t=st=1727603241~exp=1727606841~hmac=db106908f8f6e2b46440b1567ede21f091fabca4c6f19e226cb69d8f7111f921&w=1060" 
            alt="Nature" 
          />
        </div>
      </div>
      <Footer />
    </div>
  );
};

export default Home;
